B.UP=new A.aG("Apabila melalui aplikasi, download aplikasi Biller terlebih dulu, kemudian buka aplikasi dan pilih menu 'Register'. Masukkan nama, nomor ponsel, alamat email, dan password, lalu klik 'Register'.",null,B.u,null,null,null,null,null,null)
